import{_ as t,a}from"./chunks/rtk_cuav_c-rtk_to_6pin_connector.CPckekK7.js";import{_ as e,c as r,o as d,ab as o}from"./chunks/framework.CUflZczI.js";const f=JSON.parse('{"title":"CUAV C-RTK","description":"","frontmatter":{},"headers":[],"relativePath":"ko/gps_compass/rtk_gps_cuav_c-rtk.md","filePath":"ko/gps_compass/rtk_gps_cuav_c-rtk.md"}'),s={name:"ko/gps_compass/rtk_gps_cuav_c-rtk.md"},i=o('<h1 id="cuav-c-rtk" tabindex="-1">CUAV C-RTK <a class="header-anchor" href="#cuav-c-rtk" aria-label="Permalink to &quot;CUAV C-RTK&quot;">​</a></h1><p>The <a href="https://www.cuav.net/en/c_rtk_9ps/" target="_blank" rel="noreferrer">CUAV C-RTK GPS receiver</a> is an <a href="./../gps_compass/rtk_gps.html">RTK GPS module</a> for the mass market. 완전한 RTK 시스템은 2개 이상의 C-RTK 모듈 (하나는 기지국용, 다른 하나는 항공기용)으로 구성됩니다. RTK를 사용하면 PX4는 일반 GPS에서 제공하는 것 보다 훨씬 더 정확한 센티미터 수준의 정확도로 위치를 파악할 수 있습니다.</p><img src="'+t+'" width="500px" title="C-RTK"><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?id=565380634341&amp;spm=2014.21600712.0.0" target="_blank" rel="noreferrer">cuav taobao</a></li><li><a href="https://www.aliexpress.com/store/product/CUAV-NEW-Flight-Controller-GPS-C-RTK-differential-positioning-navigation-module-GPS-for-PIX4-Pixhawk-pixhack/3257035_32853894248.html?spm=2114.12010608.0.0.75592fadQKPPEn" target="_blank" rel="noreferrer">cuav aliexpress</a></li></ul><h2 id="설정" tabindex="-1">설정 <a class="header-anchor" href="#설정" aria-label="Permalink to &quot;설정&quot;">​</a></h2><p>RTK setup and use on PX4 via <em>QGroundControl</em> is largely plug and play (see <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> for more information).</p><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p>C-RTK GPS comes with a cable that terminates in a 6-pin connector and 4-pin connector that are compatible with <a href="https://doc.cuav.net/flight-controller/pixhack/en/quick-start-pixhack-v3x.html#gps--compass" target="_blank" rel="noreferrer">Pixhack v3</a>. 6핀 커넥터는 RTK GPS 용 인터페이스를 제공하며 비행 콘트롤러의 GPS 포트에 연결하여야합니다. 4핀 커넥터는 두 번째 GPS로 사용하기 위한 (옵션) m8n (표준) GPS 인터페이스입니다.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>이 문서 작성시에는 PX4는 아직 두 번째 GPS를 완전하게 지원하지 않습니다. 4핀 포트는 연결할 필요 없습니다.</p></div><img src="'+a+'" width="500px" title="C-RTK_6PIN"><p>다른 비행 콘트롤러 보드에 연결하려면 케이블/커넥터를 수정하여야 하는 경우도 있습니다. <em>Pixhawk 3 Pro</em>와 <em>Pixracer</em>의 핀 매핑은 다음과 같습니다.</p><h3 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h3><p>C-RTK GPS 핀배열은 아래와 같습니다. 이것은 다른 자동조종보드용 커넥터를 수정할 수 있습니다.</p><table><thead><tr><th>핀</th><th>C-RTK GPS 6P</th><th>핀</th><th>Pixhawk 3 Pro GPS</th><th>C-RTK GPS 4P</th></tr></thead><tbody><tr><td>1</td><td>SDA</td><td>1</td><td>VCC</td><td></td></tr><tr><td>2</td><td>SCL</td><td>2</td><td>GPS_TX</td><td></td></tr><tr><td>3</td><td>GPS_RX</td><td>3</td><td>GPS_RX</td><td>GPS_RX</td></tr><tr><td>4</td><td>GPS_TX</td><td>4</td><td>SCL</td><td>GPS_TX</td></tr><tr><td>5</td><td>VCC_5V</td><td>5</td><td>SDA</td><td>VCC_5V</td></tr><tr><td>6</td><td>GND</td><td>6</td><td>GND</td><td>GND</td></tr></tbody></table>',15),c=[i];function h(l,n,p,_,m,P){return d(),r("div",null,c)}const S=e(s,[["render",h]]);export{f as __pageData,S as default};
